import logo from './logo.svg';
import './App.css';

function App() {

  let posts_article = 'posts article입니다.'

  let posts = '여기는 React 연습 블로그이고';
  // 변수를 지정 후, 이 변수를 넣고 싶은 곳에 {변수}로 넣어주면 됨

  function posts_f() {
    return '이것은 함수 예제입니다.';
  }

  return (
    <div className="App">
     {/* class라는 예약어가 있기 때문에 class 지정을 className으로 함*/}
      <div className="black-nav">
        <div style={{color : '#424242', fontSize : '30px'}}>React 연습 Blog</div>
        {/* className에도 변수 지정 가능 */}
      </div>
      <img src={logo}/>
      {/* 원하는 이미지를 import 해온 후, {}안에 이미지 이름을 지정 */}
      {/* 일반적인 html의 이미지명.jpg도 사용 가능 */}
      <h4 className={posts_article}>{posts}, {posts_f()}</h4>
    </div>
  );
}

export default App;
